import React from "react";
import { useTranslation } from 'react-i18next';


import './BikeList.css'
import BikeListItem from '../components/BikeListItem'

const BikeList = () => {

    const { t } = useTranslation();

    // TODO: implement fetching
    let bikes = [
        {
            id: 1,
            name: "Lastenrad 1",
            imagePath: "bike1.jpg"
        },
        {
            id: 2,
            name: "Lastenrad 2",
            imagePath: "../assets/images/bike2.jpg"
        },
        {
            id: 3,
            name: "Lastenrad 3",
            imagePath: "../assets/images/bike3.jpg"
        },
        {
            id: 4,
            name: "Lastenrad 4",
            imagePath: "../assets/images/bike4.jpg"
        },
        {
            id: 5,
            name: "Lastenrad 5",
            imagePath: "../assets/images/bike5.jpg"
        },
    ]

    // FIXME: hover response of all buttons

    return (
        <>
            <h1>Heading</h1>

            <ul className="list">
                {bikes.map((bike) => (
                    <BikeListItem bike={bike} key={bike.id}/>
                ))}
            </ul>

            <img className="img" title={bike.name} source={bike.imagePath}></img>

        </>
    );
};

export default BikeList;
